    <div className='cardstyle'>
        <div className='card'>
        <img className='card-image' alt='monster' src={`images/${props.monster.id}.png` }/>

        <h2>
            TITLE: {props.monster.title}
        
         AUTHOR: {props.monster.authors}</h2>
            
        </div>
   
    TITLE: {props.monster.title}
    </div>
)
